    geo_json_65d80fccf887290aac6d6eadd487add2.bindTooltip(
      function (layer) {
        let div = L.DomUtil.create("div");

        let handleObject = (feature) =>
          typeof feature == "object" ? JSON.stringify(feature) : feature;
        let fields = [
          "planning_area",
          "project",
          "sqft",
          "floorRange",
          "predicted_date",
          "predicted price",
          "predicted_increase(%)",
        ];
        let aliases = [
          "Planning Area",
          "Project",
          "Size(sqft)",
          "Floor Range",
          "Predicted Date",
          "Predicted Price",
          "Predicted Increase(%)",
        ];
        let table =
          "<table>" +
          String(
            fields
              .map(
                (v, i) =>
                  `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`
              )
              .join("")
          ) +
          "</table>";
        div.innerHTML = table;

        return div;
      },
      { className: "foliumtooltip", sticky: true }
    );
